                    "y": 60.0,
                    "data": "\u5728\u957f\u65f6\u95f4\u8fd0\u884c\u4f60\u7684DTPF[note](8\u5c0f\u65f6)[/note]\u4e4b\u540e,\u53ef\u4ee5\u8ba9\u591a\u7ef4\u7a7a\u95f4\u5b8c\u7f8e\u5bf9\u9f50.%n%n\u51ed\u501f\u4f60\u65b0\u83b7\u5f97\u7684\u6280\u672f,\u4f60\u73b0\u5728\u53ef\u4ee5\u5b8c\u7f8e\u540c\u6b65\u5730\u5229\u7528\u8fd9\u4e9b\u7a7a\u95f4,\u8ba9\u4f60\u7684\u7b49\u79bb\u5b50\u953b\u7089\u4ee5\u96be\u4ee5\u7f6e\u4fe1\u7684\u901f\u5ea6\u8fd0\u884c.%n%n\u4f7f\u7528[note]\u8d85\u7ef4\u6821\u51c6\u77e9\u9635[/note]\u53ef\u4ee5\u8ba9DTPF\u4ee5\u65e0\u635f\u8d85\u9891\u7684\u65b9\u5f0f\u8fd0\u884c.\u8981\u505a\u5230\u8fd9\u4e00\u70b9,\u60a8\u9700\u8981\u8ba9DTPF\u8fbe\u5230\u6700\u5927\u6548\u7387\u72b6\u6001,\u800c\u989d\u5916\u7684\u7535\u529b\u6210\u672c\u53ef\u4ee5\u901a\u8fc7\u4f7f\u7528\u66f4\u591a\u76f8\u540c\u7684\u50ac\u5316\u5242\u6765\u62b5\u6d88.%n%n\u603b\u7684\u6765\u8bf4,\u5b83\u7684\u6548\u7387\u66f4\u9ad8,\u800c\u4e14\u5b8c\u5168\u503c\u5f97.%n%n\u8fd9\u4e2a\u8fc7\u7a0b\u6781\u5176\u8017\u8d39\u50ac\u5316\u5242.\u786e\u4fdd\u751f\u4ea7\u8db3\u591f\u7684\u50ac\u5316\u5242\u6765\u7ef4\u6301\u5b83\u4fdd\u6301\u8fd0\u8f6c.%n%n\u5bf9\u4e8e\u6ca1\u6709\u50ac\u5316\u5242\u7684\u914d\u65b9,\u5fc5\u987b\u5728GUI\u4e2d\u53f3\u51fb\u7ef4\u5ea6\u6536\u655b\u6309\u94ae\u6765\u6307\u5b9a\u50ac\u5316\u5242,\u5426\u5219\u5c06\u9ed8\u8ba4\u4e3a\u7c97\u5236\u8d85\u7ef4\u5ea6\u50ac\u5316\u5242.[/note]%n%n[note]\u5199\u7ed9\u597d\u5947\u8005\u7684\u6570\u5b66\u8ba1\u7b97\uff1a%n%n\u4e3a\u4e86\u5f04\u6e05\u695a\u540e\u53f0\u5230\u5e95\u53d1\u751f\u4e86\u4ec0\u4e48.\u4e0b\u9762\u4ee5\u4e00\u4e2a\u4f8b\u5b50\u6765\u89e3\u91ca\u989d\u5916\u50ac\u5316\u5242\u6d88\u8017\u503c\u662f\u5982\u4f55\u8ba1\u7b97\u7684\uff1a%n%n\u6240\u9009\u7684\u793a\u4f8b\u914d\u65b9\u662f\u4f7f\u7528\u5e73\u51e1\u8d85\u7ef4\u5ea6\u50ac\u5316\u5242\u7684\u7194\u878d\u4e2d\u5b50\u914d\u65b9.\u4ee564AUMV(8,589,934,592EU/t)\u8fd0\u884c.%n%n\u5728\u4e0d\u4f7f\u7528\u8d85\u9891\u6216DTPF\u50ac\u5316\u5242\u51cf\u514d\u7684\u60c5\u51b5\u4e0b.\u6bcf\u6b21\u914d\u65b9\u8fd0\u884c\u4f7f\u7528\u4e8614,753\u5347\u5e73\u51e1\u8d85\u7ef4\u5ea6\u50ac\u5316\u5242\u548c36,484,545,600EU.\u50ac\u5316\u5242\u51cf\u514d\u89e6\u53d1\u540e.\u50ac\u5316\u5242\u7528\u91cf\u51cf\u534a.\u53737,376.5\u5347\u50ac\u5316\u5242.\u56db\u820d\u4e94\u5165\u540e\u4e3a7,376\u5347.\u7531\u4e8e\u673a\u5668\u914d\u5907\u4e8664AUMV.\u914d\u65b9\u8d85\u98913\u6b21.\u5373\u6bcf\u4e2a\u914d\u65b9\u5b9e\u9645\u4f7f\u752836,484,545,600*2^3",
