                    "x": -144.0,
                    "y": 72.0,
                    "data": "\u51b7\u5374\u91d1\u5c5e\u952d\u662f\u6bd4\u7194\u70bc\u91d1\u5c5e\u952d\u66f4\u5927\u7684\u6311\u6218.%n%n\u5e78\u8fd0\u7684\u662f,\u7528\u65b0\u6750\u6599\u5f3a\u5316\u4e00\u4e9b\u673a\u68b0\u65b9\u5757,\u53ef\u4ee5\u5141\u8bb8\u4f60\u5411\u5176\u6ce8\u5165\u5148\u8fdb\u51b7\u5374\u5242,\u8fd9\u4e9b\u51b7\u5374\u5242\u53ef\u4ee5\u6355\u83b7\u5fae\u578b\u65f6\u7a7a\u4e2d\u7684\u6781\u7aef\u70ed\u91cf,\u5e2e\u52a9\u4f60\u66f4\u5feb\u5730\u51b7\u5374\u91d1\u5c5e\u952d.%n%n\u901a\u8fc7\u4e9a\u7a7a\u95f4\u51b7\u5374,\u4f60\u53ef\u4ee5\u8ba9\u5de8\u578b\u771f\u7a7a\u51b7\u51bb\u673a\u5b9e\u73b0\u65e0\u635f\u8d85\u9891......\u4f46\u9700\u8981\u4ed8\u51fa\u4e00\u5b9a\u7684\u4ee3\u4ef7.%n%n\u7b2c1\u7ea7\u5c06\u4ee5[warn]7500L/s[/warn]\u7684\u901f\u5ea6\u6d88\u8017\u6db2\u6001\u65f6\u7a7a,\u5e76\u5141\u8bb81\u6b21\u65e0\u635f\u8d85\u9891.%n%n[note]\u8fd9\u4e2a\u4ee3\u4ef7\u975e\u5e38\u9ad8,\u4f46\u4e0d\u4f1a\u6539\u53d8,\u5728\u8fd0\u884c\u6bcf\u4e2a\u914d\u65b9\u65f6\u90fd\u662f\u4e00\u6837\u7684.\u56e0\u6b64,\u5728\u51b7\u5374\u91d1\u5c5e\u952d\u65f6\u8981\u6709\u6240\u9009\u62e9.%n%n\u914d\u65b9\u901f\u5ea6\u8d8a\u5feb,\u6210\u672c\u6548\u7387\u8d8a\u9ad8,\u56e0\u6b64\u8981\u627e\u5230\u81ea\u5df1\u7684\u6700\u4f73\u5e73\u8861\u70b9.[/note]%n%n\u65e0\u5c3d\u51b7\u5374\u673a\u68b0\u65b9\u5757\u53d6\u4ee3\u4e86\u9632\u51bb\u673a\u68b0\u65b9\u5757,\u56e0\u6b64\u4f60\u4e0d\u5fc5\u62c5\u5fc3\u4f1a\u635f\u574f\u4f60\u7684\u8bbe\u7f6e\u4e0e\u5e03\u5c40.",
