                    "data": "\u638c\u63a7\u65f6\u7a7a,\u4f60\u5df2\u7ecf\u53ef\u4ee5\u8ba9\u6e29\u5ea6\u63a5\u8fd1\u7edd\u5bf9\u96f6\u5ea6,\u8fd9\u4f7f\u5f97\u7814\u53d1\u66f4\u68d2\u7684\u51b7\u5374\u5355\u5143\u6210\u4e3a\u53ef\u80fd.\u7279\u5236\u7684\u673a\u68b0\u65b9\u5757\u53ef\u4f7f\u5185\u90e8\u4fdd\u6301\u6781\u4f4e\u6e29\u5ea6,\u540c\u65f6\u7eb3\u7c73\u8702\u7fa4\u5f97\u76ca\u4e8e\u5176\u6781\u5c0f\u7684\u4f53\u578b,\u53ef\u4ee5\u6709\u6548\u5730\u8fdb\u884c\u70ed\u91cf\u4f20\u9012.\u5355\u6709\u8fd9\u4e9b\u4ecd\u7136\u4e0d\u591f,\u8fd8\u9700\u8981\u4e00\u4e9b\u51b7\u5374\u6db2,\u4f46\u5728\u6b64\u6e29\u5ea6\u4e0b\u6c34\u4f1a\u7ed3\u51b0,\u6240\u4ee5\u8d85\u7ea7\u51b7\u5374\u6db2\u6210\u4e3a\u4e86\u6211\u4eec\u7684\u9009\u62e9.%n%n[note]\u8fd0\u884c\u65f6,\u7a7a\u51bb\u5854\u6bcf\u79d2\u6d88\u801710\u5347\u8d85\u7ea7\u51b7\u5374\u6db2,\u8ba9\u673a\u5668\u8fdb\u884c4/4\u8d85\u9891.\u8f93\u5165\u4ed3\u4f4d\u4e8e\u7a7a\u51bb\u5854\u7684\u5e95\u5c42\u4e2d\u592e.[/note]%n%n[warn]\u6b64\u5347\u7ea7\u4e0e\u6c34\u51b7\u5854\u4e0d\u517c\u5bb9.[/warn]",
